import React from 'react'
import dummy from '../resource/dummyData'
import './ContentList.css'

function ContentList() {
  return (
    <div>
      {dummy.map((el)=>{
        console.log(el);
        return(
          <div className="row">
            {/* data의 번호 */}
            <div className="col">{el.id}</div>
            {/* data의 제목 */}
            <div className="col">{el.title}</div>
            {/* data의 작성일자 */}
            <div className="col">{el.createdAt}</div>
          </div>
        )
        })
      }
    </div>
  )
}

export default ContentList
